// Development Environment Configuration
// For production, use environment variables instead of hardcoded values

export const environment = {
  production: false,
  
  // EmailJS Configuration
  emailService: {
    serviceId: process.env['EMAILJS_SERVICE_ID'] || 'service_odqilgs',
    templateId: process.env['EMAILJS_TEMPLATE_ID'] || 'template_oaix3xd',
    publicKey: process.env['EMAILJS_PUBLIC_KEY'] || '9_v1yNhDsF7w1lmFF'
  },
  
  // Application Configuration
  app: {
    name: 'ChaPaDevs',
    url: 'http://localhost:4200',
    version: '1.0.0'
  },
  
  // Contact Configuration
  contact: {
    email: 'admin@chapadevs.com',
    supportEmail: 'support@chapadevs.com'
  },
  
  // Feature Flags
  features: {
    enableAnalytics: false,
    enableChatWidget: false,
    maintenanceMode: false
  },
  
  // Analytics (for future use)
  analytics: {
    googleAnalyticsId: '',
    hotjarId: ''
  }
};
